import React from "react";
import "./sandbox.css";

const Sandbox = (props) => {
  return (
    <div className="canvas">
      <svg viewBox="0 0 300 300" height="300" width="300">
        <circle cx="150" cy="150" r="20" fill="hotpink" stroke="dodgerblue" />
      </svg>
    </div>
  );
};

export default Sandbox;
